            spinShow:false
        }
    },
    mounted () {
    },
    methods: {
        verifySpreadInfo (uid) {
            let that = this;
            that.spinShow = true;
            verifySpreadInfoApi(uid).then(res=>{
                that.spinShow = false;
                that.spread = res.data.spread;
            }).catch(res=>{
                that.$Message.error(res.msg);
            })
        },
        cancel () {

